import React from 'react';
import './App.css';

import { withStyles, fade } from '@material-ui/core/styles';

import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Typography from '@material-ui/core/Typography';
import Paper from '@material-ui/core/Paper';
import Container from '@material-ui/core/Container';

import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import SearchIcon from '@material-ui/icons/Search';
import InputBase from '@material-ui/core/InputBase';

import TablePagination from '@material-ui/core/TablePagination';

const styles = theme => ({
	root: {
		flexGrow: 1,
	},
	menuButton: {
		marginRight: theme.spacing(2),
	},
	title: {
		flexGrow: 1,
		display: 'none',
		[theme.breakpoints.up('sm')]: {
			display: 'block',
		},
	},
	container: {
		marginTop: theme.spacing(5),
	},
	search: {
		position: 'relative',
		borderRadius: theme.shape.borderRadius,
		backgroundColor: fade(theme.palette.common.white, 0.15),
		'&:hover': {
			backgroundColor: fade(theme.palette.common.white, 0.25),
		},
		marginLeft: 0,
		width: '100%',
		[theme.breakpoints.up('sm')]: {
			marginLeft: theme.spacing(1),
			width: 'auto',
		},
	},
	searchIcon: {
		width: theme.spacing(7),
		height: '100%',
		position: 'absolute',
		pointerEvents: 'none',
		display: 'flex',
		alignItems: 'center',
		justifyContent: 'center',
	},
	inputRoot: {
		color: 'inherit',
	},
	inputInput: {
		padding: theme.spacing(1, 1, 1, 7),
		transition: theme.transitions.create('width'),
		width: '100%',
		[theme.breakpoints.up('sm')]: {
			width: 120,
			'&:focus': {
				width: 200,
			},
		},
	},
});

class App extends React.Component {

	state = {
		restaurantList: []
	};

	componentDidMount() {
		this.getRestaurantData();
	}

	getRestaurantData = async () => {
		const response = await fetch("http://localhost:8080/api/restaurants");
		const { data } = await response.json();
		this.setState({ restaurantList : data })
	}

	handleChangePage = () => {

	}

	handleChangeRowsPerPage = () => {

	}

	render() {
		const { classes } = this.props;

		return (
			<div className="App">
				<AppBar position="static">
					<Toolbar>
						<IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
							<MenuIcon />
						</IconButton>
						<Typography variant="h6" className={classes.title}>Restaurants</Typography>
						<div className={classes.search}>
							<div className={classes.searchIcon}>
								<SearchIcon />
							</div>
							<InputBase
								placeholder="Searchâ€¦"
								classes={{
									root: classes.inputRoot,
									input: classes.inputInput,
								}}
								inputProps={{ 'aria-label': 'search' }}
							/>
						</div>
					</Toolbar>
				</AppBar>
				<Container className={classes.container}>
					<Paper>
						<Typography component="h2" variant="h6" color="primary" gutterBottom>Titre</Typography>
						<Table aria-label="simple table">
							<TableHead>
								<TableRow>
									<TableCell>Name</TableCell>
									<TableCell>Cuisine</TableCell>
									<TableCell>Borough</TableCell>
								</TableRow>
							</TableHead>
							<TableBody>
								{this.state.restaurantList.map((restaurant, key) => (
									<TableRow key={key}>
									<TableCell>{restaurant.name}</TableCell>
									<TableCell>{restaurant.cuisine}</TableCell>
									<TableCell>{restaurant.borough}</TableCell>
									</TableRow>
								))}
							</TableBody>
						</Table>
						<TablePagination
							rowsPerPageOptions={[10, 25]}
							component="div"
							count={rows.length}
							rowsPerPage={rowsPerPage}
							page={page}
							backIconButtonProps={{
								'aria-label': 'previous page',
							}}
							nextIconButtonProps={{
								'aria-label': 'next page',
							}}
							onChangePage={handleChangePage}
							onChangeRowsPerPage={handleChangeRowsPerPage}
						/>
					</Paper>
				</Container>
			</div>
		);
	}

}

export default withStyles(styles)(App);
